import { useState,  useEffect} from 'react'
import './App.css'
import axios from 'axios'

const App = () => {
  useEffect(() => {
    console.log('effect')
    axios
      .get('http://localhost:3001/notes')
      .then(response => {
        console.log('promise fulfilled')
        console.log(response.data)
        setNotes(response.data)
      })
  }, [])

  const [notes, setNotes] = useState([
    { serialNumber:'', snapshotTimestamp:'', closestDistance: 0, owner: '', ownerEmail: '' , phone:''}
  ]) 

  const showNotes = notes.map(note=> {
                                          return(<tr>
                                            <td key = "owner">Owner: {note.owner}</td >
                                            <td key = "phone">Phone: {note.phone}</td>
                                            <td key = "email">Email: {note.ownerEmail}</td>
                                            <td key = "serialNumber">serialNumber: {note.serialNumber}</td>
                                            <td key ="snapshotTimestamp">Last time: {note.snapshotTimestamp}</td>
                                            <td key = "closestDistance">closestDistance: {note.closestDistance}</td></tr>)})



  return (
    <div>
      <h2>The pilots who recently violated the NDZ perimeter.</h2>
      <>
      <table><tr><td>Owner</td><td>Phone</td><td>Email</td><td>serialNumber</td><td>Last time</td><td>closestDistance</td></tr>{showNotes}</table>
      </>
    </div>

  )
}
export default App
